import React from 'react';
import './Project.css'; // Adjust the path based on your file structure

const Octagon = ({ imageName, imageUrl, description }) => {
  return (
    <div className="card">
      <div className="leftSide">
        <img src={imageUrl} alt={imageName} className="image" />
        <p className="imageName">{imageName}</p>
      </div>
      <div className="rightSide">
        <p>{description}</p>
      </div>
    </div>
  );
};

export default Octagon;
